import React from "react";
import { Link,useNavigate } from "react-router-dom";

export default function Welcome(props) {
  const navigate=useNavigate();
  const handleonclicklogin=()=>{
    navigate('/login');
  }
    
  return (
    <>
    <div className="container" style={{display:"flex"}}>
      <button type="button" className="btn btn-outline-success" onClick={handleonclicklogin}> Login/signup for farmers</button>
      <button type="button" className="btn btn-outline-success"onClick={handleonclicklogin}>Login/signup for user</button>
    </div>
    </>
  )
}
